import React, {Component} from 'react';

const message = props => <div>{props.msg}</div>;

class Button extends Component {
    render(){
    return (
      <div class="bg-orange-200 p-3">
          {React.createElement(message, {msg: 'Hello World'})}
      </div>
    );
    }
}

export default Button;
